window.bookSummaryJSON = "<p><b>In the first book of a sizzling dystopian romance series, psychic gifts are a death sentence and there are rules to survival: Trust no one. Lie to everyone. And whatever you do, don’t fall for your greatest enemy.</b></p> <p><b>TRUST NO ONE.</b></p> <p>Wren Darlington has spent her whole life in hiding, honing her psychic abilities and aiding the rebel Uprising in small ways. On the Continent, being Modified means certain death—and Wren is one of the most powerful Mods in existence. When one careless mistake places her in the hands of the enemy and she’s forced to join their most elite training program, she’s finally handed the perfect opportunity to strike a devastating blow from inside their ranks.</p> <p><b>LIE TO EVERYONE.</b></p> <p>But training for Silver Block can be deadly, especially when you’re harboring dangerous secrets and living in close quarters with everyone who wants you dead.</p> <p><b>AND WHATEVER YOU DO, DON’T FALL FOR YOUR GREATEST ENEMY.</b></p> <p>As the stakes grow ever higher, Wren must prove herself to Silver Block. But that’s easier said than done when your commanding officer is the ruthless and infuriatingly irresistible Cross Redden, who doesn’t miss anything when it comes to her. And as war rages between Mods like her and those who aim to destroy them, Wren must decide just how far she’s willing to go to protect herself . . . and how much of the Continent is worth saving.</p>"; 
